import React, { Component } from 'react'
import HocMain from './HocMain'

class HocB extends Component {
    constructor(props) {
        super(props)
        
        this.state = {
            value:0
        }
    }
    render() {
        return (
            <>
                <div>HocB</div>
                <button className='btn btn-primary' onMO={()=>this.setState({value:this.state.value+1})}>HocA</button>
                {this.state.value}
            </>
        )
    }
}

export default HocMain(HocB)
